import React, { useState } from "react";
import { Button, Container, Col, Row } from "react-bootstrap";
import * as Icon from "react-bootstrap-icons";
import { Link } from "react-router-dom";

const OffCanvas = ({ hide }) => {
  const [show, setShow] = useState(false);
  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  return (
    <>
      <Container className="align-items-center justify-content-between mx-1  ">
        <Row>
          <div>
            <Button variant="primary" onClick={handleShow}>
              Launch
            </Button>
          </div>
        </Row>
        <Link onClick={hide} to={``}>
          <Row>
            <Col>
              <div className="d-flex align-items-center ">
                <Icon.Clock className="mr-2" size={10} />
                <span className="search-profile">
                  {"Louis"} {"Gadza"}{" "}
                </span>
                <span>
                  <Icon.Dot />
                </span>
                <span className="search-profile  title">{"profile"}</span>
              </div>
            </Col>

            <Col>
              <img className="search-profiles   " src="" alt="" />
            </Col>
          </Row>
        </Link>
      </Container>
    </>
  );
};

export default OffCanvas;
